import React from 'react';
import '../../css/header.css';
import header from './header.module.css';
import {NavLink} from "react-router-dom";
console.log(header);
const Header = () => {
    return (
        <header className={header.header}>
            <div className={header.contentHeader}>
                <div className={header.logo}>
                    <img className={header.icons} src='https://3.bp.blogspot.com/-gSCjFoMwSrM/Wmhhcg2_WsI/AAAAAAAAN0s/YF9kM5Jnt30hautbcSOIg70qUQhEGyqWgCLcBGAs/s1600/dallas_mavericks.png' ></img>
                </div>
                <div className={header.menu}>
                    <ul>
                        <li><NavLink to="/profile">Profile</NavLink> </li>
                        <li><NavLink to="/dialog">Messages</NavLink> </li>
                        <li><NavLink to="">News</NavLink> </li>
                        <li><NavLink to="">Music</NavLink> </li>
                        <li><NavLink to="">Setting</NavLink> </li>
                    </ul>
                </div>
            </div>
        </header>
    );
}
export default Header;
